function minOperations(nums1: number[], nums2: number[]): number {
    let swapCount = 0;
    const n = nums1.length;
    // Swap to make nums1[n-1] the max in nums1 and nums2[n-1] the max in nums2 if needed
    if (nums1[n-1] < Math.max(...nums1)) {
        const maxIndex1 = nums1.indexOf(Math.max(...nums1));
        [nums1[n-1], nums1[maxIndex1]] = [nums1[maxIndex1], nums1[n-1]];
        swapCount++;
    }
    if (nums2[n-1] < Math.max(...nums2)) {
        const maxIndex2 = nums2.indexOf(Math.max(...nums2));
        [nums2[n-1], nums2[maxIndex2]] = [nums2[maxIndex2], nums2[n-1]];
        swapCount++;
    }
    // Check if conditions are already met
    if (nums1[n-1] === Math.max(...nums1) && nums2[n-1] === Math.max(...nums2)) {
        return swapCount;
    }
    // Try swapping elements to meet conditions
    for (let i = 0; i < n - 1; i++) {
        if ((nums1[i] > nums1[n-1] || nums2[i] > nums2[n-1]) && nums1[i] !== nums2[i]) {
            [nums1[i], nums2[i]] = [nums2[i], nums1[i]];
            swapCount++;
            if (nums1[n-1] === Math.max(...nums1) && nums2[n-1] === Math.max(...nums2)) {
                return swapCount;
            }
        }
    }
    return -1;
};
